import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h1 
        className="text-4xl font-bold text-gray-800 mb-8 opacity-0 animate-fade-in"
      >
        Welcome to the App
      </h1>

      <button
        onClick={() => navigate('/profile')}
        className="w-64 px-6 py-3 bg-blue-500 text-white rounded-lg shadow-lg mb-4 transition-transform transform hover:scale-105"
      >
        Go to Profile
      </button>

      <button
        onClick={() => navigate('/todo')}
        className="w-64 px-6 py-3 bg-green-500 text-white rounded-lg shadow-lg transition-transform transform hover:scale-105"
      >
        Go to To-Do List
      </button>
    </div>
  );
}

export default Home;
